app.icon=branding/core/core.jar/org/netbeans/core/startup/frame48.gif
app.name=${branding.token}
app.title=Cylindrical Alignment Viewer
app.conf=nbproject/CylindricalAlignmentApp.conf
auxiliary.org-netbeans-modules-apisupport-installer.license-type=no
auxiliary.org-netbeans-modules-apisupport-installer.os-linux=true
auxiliary.org-netbeans-modules-apisupport-installer.os-macosx=true
auxiliary.org-netbeans-modules-apisupport-installer.os-solaris=false
auxiliary.org-netbeans-modules-apisupport-installer.os-windows=true
auxiliary.org-netbeans-modules-apisupport-installer.pack200-enabled=false
auxiliary.org-netbeans-spi-editor-hints-projects.perProjectHintSettingsFile=nbproject/cfg_hints.xml
modules=\
    ${project.self.lesfoster.cylindrical_alignment.viewer}:\
    ${project.self.lesfoster.cylindrical_alignment.inspector}:\
    ${project.self.lesfoster.cylindrical_alignment.legend}:\
    ${project.self.lesfoster.framework.integration}:\
    ${project.self.lesfoster.cylindrical_alignment.model}
project.self.lesfoster.cylindrical_alignment.inspector=Inspector
project.self.lesfoster.cylindrical_alignment.legend=Legend
project.self.lesfoster.cylindrical_alignment.model=Model
project.self.lesfoster.cylindrical_alignment.viewer=Viewer
project.self.lesfoster.framework.integration=Integration
run.args.extra=-J-Xmx1024m -J-Xmx8192m
